const CarDetails = (props) => {

  const {brandName} = props.item

  return (
    <>
      <center><h1>Showing Car Details</h1></center>
      <div className="Container">
          <div>
          <h5>Brand Name: {brandName}</h5>
          <h5>Model Name: {modelName}</h5>
          <h5>Year: {year}</h5>
          <h5>Price: ${price}</h5>
          <h5>Mileage: {imileage}</h5>
          <h5>Fuel Type: {fuelType}</h5>
          <h5>Transmission Type: {transmissionType}</h5>
          <p>Description: {description}</p>
          </div>
      </div>
    </>

  );
};

export default CarDetails;
